import { useState } from "react";

interface User {
	id:			number;
	email:		string;
	firstName?:	string;
	lastName?:	string;
	userName?:	string;
}

async function getUsers() {
	try {
	  const response = await axios.get('http://localhost:3001/user');
	//   console.log(response);
	  return response.data;
	} catch (error) {
	  console.error(error);
	  return [];
	}
  }

const App:React.FC = () =>
{
	const [display, setDisplay] = useState<User[]>([]);
	const res = getUsers();
	// var data: Array<User> = [];


	res.then((val) => {
		for (var i = 0; i < val.length; i++)
		{
			// data.push(val[i]);
			setDisplay(val[i]);
		}
		console.log(display);
	})

	return (
		<div> 
			<h1>These are all the Users!</h1>
		</div>
	);
}

export default App;
